import React, { Component } from "react";

class Conditionals extends Component {
  constructor(props) {
    super(props);

    this.state = {
      isLoggedIn: true,
    };
  }

  render() {
    if (this.state.isLoggedIn) {
      return <div>Welcome Guest</div>;
    } else {
      return <div>Welcome Titan</div>;
    }
  }
}

export default Conditionals;
